"    <div id=\"topicTitle\">",
"     Patient information: Calcium and vitamin D for bone health (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/calcium-and-vitamin-d-for-bone-health-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H1665286915\">",
"      <span class=\"h1\">",
"       Why are calcium and vitamin D important for bone health?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Calcium and vitamin D are important for bone health, because they can:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Help keep bones strong",
"       </li>",
"       <li>",
"        Prevent bones from breaking easily, especially bones in the spine",
"       </li>",
"       <li>",
"        Help keep teeth healthy and strong",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1665286922\">",
"      <span class=\"h1\">",
"       What can happen if people do not have healthy bones?",
"      </span>",
"      &nbsp;&mdash;&nbsp;People who do not have healthy bones can have a condition called &ldquo;osteoporosis.&rdquo; Osteoporosis can cause bones to:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Become thin and weak",
"       </li>",
"       <li>",
"        Break more easily &ndash; Bone breaks often occur in the spine, hip, and arm bones near the wrist.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Doctors can use different treatments for osteoporosis, including medicines. But it&rsquo;s also important to eat and drink foods that have calcium and vitamin D. Eating enough calcium and vitamin D is an important first step in preventing and treating osteoporosis.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1665286929\">",
"      <span class=\"h1\">",
"       What foods and drinks have calcium and vitamin D?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Different foods and drinks have calcium and vitamin D (",
"      <a class=\"graphic graphic_figure graphicRef79375 \" href=\"mobipreview.htm?18/13/18647\">",
"       figure 1",
"      </a>",
"      ). Some foods and drinks have more calcium and vitamin D than others.",
"     </p>",
"     <p>",
"      Foods and drinks that have a lot of calcium include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Milk, yogurt, cheese, cottage cheese, ice cream, and other dairy foods",
"       </li>",
"       <li>",
"        Green vegetables, such as kale, collard greens, and broccoli",
"       </li>",
"       <li>",
"        Certain nuts and breads",
"       </li>",
"       <li>",
"        Foods that have calcium added to them, such as juices, cereals, and soy products",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Foods and drinks that have a lot of vitamin D include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Milk, orange juice, or yogurt with vitamin D added",
"       </li>",
"       <li>",
"        Cooked salmon or mackerel",
"       </li>",
"       <li>",
"        Canned tuna fish",
"       </li>",
"       <li>",
"        Cereals with vitamin D added",
"       </li>",
"       <li>",
"        Cod liver oil",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      People&rsquo;s bodies can also get vitamin D from the sun. The body uses sunlight that shines on the skin to make vitamin D.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1665286936\">",
"      <span class=\"h1\">",
"       What are supplements?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Supplements are pills, capsules, liquids, or tablets that have nutrients in them. Supplements are another way people can get calcium and vitamin D. Some supplements contain either calcium or vitamin D. Others have both.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1665286943\">",
"      <span class=\"h1\">",
"       Do I need to take calcium or vitamin D supplements?",
"      </span>",
"      &nbsp;&mdash;&nbsp;People who do not get enough calcium or vitamin D from their food and drink might need to take supplements.",
"     </p>",
"     <p>",
"      If your doctor recommends that you take calcium or vitamin D supplements, ask him or her which type, how much, and when to take the supplements. For example, some calcium supplements can be taken with food, but others should be taken on an empty stomach.",
"     </p>",
"     <p>",
"      The type and dose of supplement that is right for you will also depend on your medical problems and the other medicines you take.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1665286950\">",
"      <span class=\"h1\">",
"       What are some common side effects of calcium supplements?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Common side effects of calcium supplements can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Constipation &ndash; People who are constipated can have trouble having bowel movements.",
"       </li>",
"       <li>",
"        Upset stomach",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Many people find that they can reduce these side effects by splitting up their calcium dose. For example, they might take a few small doses of calcium each day instead of one large dose.",
"     </p>",
"     <p>",
"      Taking calcium supplements can also increase a person&rsquo;s chance of getting kidney stones. Kidney stones are small, hard stone-like objects that can form in a person&rsquo;s kidneys.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1665286957\">",
"      <span class=\"h1\">",
"       How much calcium and vitamin D do I need each day?",
"      </span>",
"      &nbsp;&mdash;&nbsp;It depends, because each person is different. Ask your doctor or nurse how much calcium and vitamin D you need each day. Women who have gone through menopause and no longer get monthly periods usually need more calcium each day than women who still get monthly periods.",
"     </p>",
"     <p>",
"      It is important not to take too much calcium or vitamin D. Taking too much calcium or vitamin D can cause problems.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1665286964\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?34/58/35746?source=see_link\">",
"       Patient information: Osteoporosis (The Basics)",
"      </a>",
"      <br/>",
