"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?12/57/13202?source=see_link\">",
"       Patient information: Vitamin D for babies and children (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?22/60/23491?source=see_link\">",
"       Patient information: Calcium and vitamin D for bone health (Beyond the Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?24/49/25366?source=see_link\">",
"       Patient information: Osteoporosis prevention and treatment (Beyond the Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?1/29/1491?source=see_link\">",
"       Patient information: Bone density testing (Beyond the Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?14/62/15331?source=see_link\">",
"       Patient information: Vitamin D deficiency (Beyond the Basics)",
"      </a>",
"     </p>",
