var title_f35_12_36035="Grading of hirsutism";
var content_f35_12_36035=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F66629&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F66629&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 475px\">",
"   <div class=\"ttl\">",
"    Grading of severity of hirsutism in women",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 455px; height: 284px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Hirsutism scoring standards at different sites showing the spectrum from minimal hirsutism (grade 1) to frank virilization (grade 4), based on the hormonal score scale of Ferriman and Gallwey. In the general population in the United States, a score of &lt;8 is normal, 8 to 15 indicates mild hirsutism, and &ge;15 indicates moderate to severe hirsutism.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Hatch R, Rosenfield RS, Kim MH, Tredway D. Hirsutism: implications, etiology, and management. Am J Obstet Gynecol 1981; 140:815. Copyright &copy; 1981 Elsevier.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
