var title_f35_12_36038="Toxoplasma gondii life cycle";
var content_f35_12_36038=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F74001&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F74001&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 490px\">",
"   <div class=\"ttl\">",
"    The Toxoplasma gondii life cycle and pathways for infection",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 470px; height: 567px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The only source for the production of T. gondii oocysts (sporozoites) is the feline intestinal tract. Acquired disease in humans occurs by direct ingestion of oocysts from contaminated sources (soil, cat litter, garden vegetables) or by ingestion of tissue cysts (bradyzoites) present in undercooked tissues from infected animals. Fetal infection most commonly occurs after acute maternal infection in pregnancy, but it can also occur after reactivation of latent infection in immunocompromised women. Pathways leading to human disease are indicated by solid arrows, and pathways leading to feline infection are indicated by broken arrows.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Lynfield R, Guerina NG. Toxoplasmosis. Pediatr Rev 1997; 18:75. Copyright &copy; 1997 American Academy of Pediatrics.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
